INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (199, '"11. Windtenstraße 3"', 'City walks', NULL, '"Auf der Kuppe des Wienerberges steht der Wasserturm als eines der markantesten Bauwerke im Stil des industriellen Historismus. Er wurde in den Jahren 1898/99 errichtet und versorgte die hoch gelegenen Gebiete des 10. und 12. Bezirkes mit Trinkwasser."', NULL, '"Auf der Kuppe des Wienerberges steht der Wasserturm als eines der markantesten Bauwerke im Stil des industriellen Historismus. Er wurde in den Jahren 1898/99 errichtet und versorgte die hoch gelegenen Gebiete des 10. und 12. Bezirkes mit Trinkwasser."',0,0, 48.16908071162631, 16.353343195852403, 'Wasserturm Favoriten', NULL, NULL, NULL, NULL, '3', 'http://www.wien.gv.at/wienwasser/bildung/turm.html');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (200, NULL, 'City walks', NULL, '"""Tel Aviv Beach"" - ein Szenetreffpunkt anlässlich des 100-jährigen Jubiläums der israelitischen Metropole."', NULL, '"""Tel Aviv Beach"" - ein Szenetreffpunkt anlässlich des 100-jährigen Jubiläums der israelitischen Metropole."',0,0, 48.21714354529954, 16.37344639656966, 'Tel Aviv Beach', NULL, NULL, NULL, NULL, '2', 'http://www.wien.gv.at/stadtentwicklung/projekte/zielgebiete/donaukanal/projekte/archiv/tel-aviv-beac');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (201, '"16. Ottakringer Straße 91-93"', 'City walks', NULL, '"Bereits 1838 wurde auf dem Grund in Ottakring ein Brauhaus errichtet. Heute befindet sich hier die Ottakringer Brauerei AG die auf eine lange Tradition zurückblicken kann."', NULL, '"Bereits 1838 wurde auf dem Grund in Ottakring ein Brauhaus errichtet. Heute befindet sich hier die Ottakringer Brauerei AG die auf eine lange Tradition zurückblicken kann."',0,0, 48.2133460925182, 16.322795845052177, 'Ottakringer Brauerei', NULL, NULL, NULL, NULL, '4', 'http://www.wien.gv.at/spaziergang/ringlinien/ottakringer-brauerei.html');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (202, '"16. Brunnengasse und Yppenplatz"', 'City walks', NULL, '"Bereits 1786 entstand rund um einen heute nicht mehr existenten Brunnen der Brunnenmarkt. Am anschließenden Yppenplatz besteht seit 1897 der Yppenmarkt. Beide Märkte sind heute fast zu einem großen Detailmarkt verwachsen und erfreuen sich großer Beliebtheit."', NULL, '"Bereits 1786 entstand rund um einen heute nicht mehr existenten Brunnen der Brunnenmarkt. Am anschließenden Yppenplatz besteht seit 1897 der Yppenmarkt. Beide Märkte sind heute fast zu einem großen Detailmarkt verwachsen und erfreuen sich großer Beliebtheit."',0,0, 48.213642275241, 16.33665791141039, 'Brunnenmarkt / Yppenmarkt', NULL, NULL, NULL, NULL, '4', 'http://www.wien.gv.at/wirtschaft/marktamt/maerkte/ottakring.html');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (203, '"16. Lerchenfelder Gürtel"', 'City walks', NULL, '"Entlang des ehemaligen Linienwalls wurde 1895 mit dem Bau der Wiener Stadtbahn begonnen. Mitte der 1990er allerdings drohte eine Verödung des städtischen Lebensraums um den Gürtel. Durch Revitalisierungsmaßnahmen entstand dort eine junge Kulturszene die in den Clubs und Bars in den Stadtbahnbögen präsent ist."', NULL, '"Entlang des ehemaligen Linienwalls wurde 1895 mit dem Bau der Wiener Stadtbahn begonnen. Mitte der 1990er allerdings drohte eine Verödung des städtischen Lebensraums um den Gürtel. Durch Revitalisierungsmaßnahmen entstand dort eine junge Kulturszene die in den Clubs und Bars in den Stadtbahnbögen präsent ist."',0,0, 48.2094986343185, 16.33888964785888, 'Lerchenfelder Gürtel', NULL, NULL, NULL, NULL, '4', 'http://www.wien.gv.at/stadtentwicklung/projekte/zielgebiete/westguertel/geschichte.html');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (204, '"8. Josefstädter Straße 26"', 'City walks', NULL, 'Das Theater wurde 1788 gegründet und ist nach Umbauten und Renovierungen die älteste theatralische Institution auf Wiener Boden. Unter anderem gastierte Ferdinand Raimund hier und Max Reinhardt leitet das Theater von 1924-1926.', NULL, 'Das Theater wurde 1788 gegründet und ist nach Umbauten und Renovierungen die älteste theatralische Institution auf Wiener Boden. Unter anderem gastierte Ferdinand Raimund hier und Max Reinhardt leitet das Theater von 1924-1926.',0,0, 48.2095287033162, 16.351055063211998, 'Theater in der Josefstadt', NULL, NULL, NULL, NULL, '4', 'http://www.wien.gv.at/spaziergang/ringlinien/josefstadttheater.html');
