INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (307, '"1. Radetzkystraße 2"', 'City walks', NULL, 'Das Bundesamtsgebäude Radetzkystraße besteht aus drei ringförmigen Achtecken (Oktogonen) und Höfen der Obergeschoße. An den Straßenfronten wurde die achteckige Form an eine gerade Blockform angeglichen.', NULL, 'Das Bundesamtsgebäude Radetzkystraße besteht aus drei ringförmigen Achtecken (Oktogonen) und Höfen der Obergeschoße. An den Straßenfronten wurde die achteckige Form an eine gerade Blockform angeglichen.',0,0, 48.2109141586839, 16.386083763482794, 'BMVIT', NULL, NULL, NULL, NULL, '4', 'http://www.wien.gv.at/spaziergang/ringlinien/bmvit.html');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (308, '"1. Uraniastraße 1"', 'City walks', NULL, 'Das Wiener Volksbildunghaus wurde nach Plänen von Max Fabiani erbaut und 1910 eröffnet. Die Eingangshalle wurde 1935 angebaut. Die Urania beherbergt weiters eine Sternwarte sowie ein Kino.', NULL, 'Das Wiener Volksbildunghaus wurde nach Plänen von Max Fabiani erbaut und 1910 eröffnet. Die Eingangshalle wurde 1935 angebaut. Die Urania beherbergt weiters eine Sternwarte sowie ein Kino.',0,0, 48.21155856640, 16.38390323988515, 'Urania', NULL, NULL, NULL, NULL, '4', 'http://www.wien.gv.at/spaziergang/ringlinien/urania.html');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (309, '"1. Ruprechtsplatz"', 'City walks', NULL, '"Die Ruprechtskirche ist zum Teil noch aus dem frühen 9. Jahrhundert erhalten und somit die älteste Kirche Wiens. Sie ist eine einfache romanische Kirche die auch die ältesten Glasmalereien Wiens beherbergt (13. Jhd.)."', NULL, '"Die Ruprechtskirche ist zum Teil noch aus dem frühen 9. Jahrhundert erhalten und somit die älteste Kirche Wiens. Sie ist eine einfache romanische Kirche die auch die ältesten Glasmalereien Wiens beherbergt (13. Jhd.)."',0,0, 48.21202183307830, 16.374361822573604, 'Ruprechtskirche', NULL, NULL, NULL, NULL, '4', 'http://www.wien.gv.at/spaziergang/ringlinien/ruprechtskirche.html');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (310, '"1. Morzinplatz"', 'City walks', NULL, 'Am Morzinplatz befand sich die Gestapo-Leitstelle Wien. Eine Bronzefigur und ein Block aus Mauthausener Granit (err. 1951) symbolisieren das Schicksal der Opfer. ', NULL, 'Am Morzinplatz befand sich die Gestapo-Leitstelle Wien. Eine Bronzefigur und ein Block aus Mauthausener Granit (err. 1951) symbolisieren das Schicksal der Opfer. ',0,0, 48.2127541116657, 16.374631419541807, 'Gestapo-Mahnmal', NULL, NULL, NULL, NULL, '4', 'http://www.wien.gv.at/spaziergang/ringlinien/gestapo.html');
