INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (312, '"2. Karmeliterplatz Im Werd Krummbaumgasse Leopoldsgasse Haidgasse"', 'City walks', NULL, 'Der Karmeliter Markt ist einer der ältesten noch bestehenden Märkte Wiens. Kaiser Leopold I. erlaubte 1671 die Abhaltung eines Wochenmarktes für Lebensmittel und Vieh auf dem Platz vor der Karmeliterkirche.', NULL, 'Der Karmeliter Markt ist einer der ältesten noch bestehenden Märkte Wiens. Kaiser Leopold I. erlaubte 1671 die Abhaltung eines Wochenmarktes für Lebensmittel und Vieh auf dem Platz vor der Karmeliterkirche.',0,0, 48.2158007073686, 16.37979565098525, 'Karmeliterplatz', NULL, NULL, NULL, NULL, '4', 'http://www.wien.gv.at/wirtschaft/marktamt/maerkte/leopoldstadt.html');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (313, '"2. Augartenspitz Ecke Taborstrasse/Obere Augartenstrasse"', 'City walks', NULL, 'Der Augarten ist eine historische sowie denkmalgeschützte Gartenanlage und zudem wichtiger Naherholungsraum im dicht bebauten Gebiet der Leopoldstadt. Entstanden ist er Anfang des 17. Jahrhunderts im Augebiet. Auch finden sich die Gebäude der Wiener Porzellanmanufaktur sowie der Wiener Sägerknaben dort.', NULL, 'Der Augarten ist eine historische sowie denkmalgeschützte Gartenanlage und zudem wichtiger Naherholungsraum im dicht bebauten Gebiet der Leopoldstadt. Entstanden ist er Anfang des 17. Jahrhunderts im Augebiet. Auch finden sich die Gebäude der Wiener Porzellanmanufaktur sowie der Wiener Sägerknaben dort.',0,0, 48.22198807296684, 16.37977623524367, 'Augarten', NULL, NULL, NULL, NULL, '4', 'http://www.wien.gv.at/stadtentwicklung/grundlagen/leitbilder/augarten/index.html');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (314, '"19. Gassen rund um den Beethovengang (Endstation)"', 'City walks', NULL, 'Das Wiener Lied und der Wiener Schmäh sind beim Heurigen daheim. Traditionell wird der Wiener Wein in diesen Buschenschanken genossen.', NULL, 'Das Wiener Lied und der Wiener Schmäh sind beim Heurigen daheim. Traditionell wird der Wiener Wein in diesen Buschenschanken genossen.',0,0, 48.2598622890639, 16.360863884876483, 'Nussdorf (Heurigenwirte)', NULL, NULL, NULL, NULL, '5', 'http://www.wien.gv.at/spaziergang/ringlinien/nussdorf.html');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (315, '"19. Heiligenstädterstraße 82-92"', 'City walks', NULL, '"In den Jahren 1926-1930 entstand der Karl-Marx-Hof nach Plänen von Karl Ehn. Die Anlage besitzt eine Frontlänge von fast 1.200 Meter und ist ein Symbol des sozialen Wohnbaus welches in den 1990er Jahren renoviert wurde."', NULL, '"In den Jahren 1926-1930 entstand der Karl-Marx-Hof nach Plänen von Karl Ehn. Die Anlage besitzt eine Frontlänge von fast 1.200 Meter und ist ein Symbol des sozialen Wohnbaus welches in den 1990er Jahren renoviert wurde."',0,0, 48.25021244690902, 16.364096377273647, 'Karl-Marx-Hof', NULL, NULL, NULL, NULL, '5', 'http://www.wien.gv.at/spaziergang/ringlinien/karl-marx-hof.html');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (316, '"1. Maria-Theresien-Platz"', 'City walks', NULL, 'Mit seiner Kollektion berühmter Werke und der weltgrößten Bruegel-Sammlung zählt es heute zu den bedeutendsten Kunstsammlungen der Welt.', NULL, 'Mit seiner Kollektion berühmter Werke und der weltgrößten Bruegel-Sammlung zählt es heute zu den bedeutendsten Kunstsammlungen der Welt.',0,0, 48.2037537894243, 16.361863442300837, 'Kunsthistorisches Museum', NULL, NULL, NULL, NULL, '4', 'http://www.wien.gv.at/spaziergang/ringlinien/kunsthistorisch.html');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (317, '"1. Hofburg"', 'City walks', NULL, 'Mehr als sieben Jahrhunderte lang wurde das Imperium des Habsburgerreiches von der Hofburg aus regiert. Heute befinden sich der Amtssitz des Bundespräsidenten sowie ein bedeutendes Kongresszentrum und zahlreiche Kunstsammlungen in der Hofburg.', NULL, 'Mehr als sieben Jahrhunderte lang wurde das Imperium des Habsburgerreiches von der Hofburg aus regiert. Heute befinden sich der Amtssitz des Bundespräsidenten sowie ein bedeutendes Kongresszentrum und zahlreiche Kunstsammlungen in der Hofburg.',0,0, 48.2065583875493, 16.365519288972074, 'Hofburg/Heldenplatz', NULL, NULL, NULL, NULL, '4', 'http://www.wien.gv.at/spaziergang/ringlinien/hofburg.html');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (318, '"1. Josephsplatz 1"', 'City walks', NULL, 'Anstelle der von den Franzosen verwüsteten Festungswerke entstand ab 1818 ein Garten. Bis 1901 wandelte er sich zu einem englischen Landschaftsgarten und ein Jugendstilglashaus nach Plänen von Friedrich Ohmann kam hinzu. ', NULL, 'Anstelle der von den Franzosen verwüsteten Festungswerke entstand ab 1818 ein Garten. Bis 1901 wandelte er sich zu einem englischen Landschaftsgarten und ein Jugendstilglashaus nach Plänen von Friedrich Ohmann kam hinzu. ',0,0, 48.2042751980656, 16.365745213007514, 'Burggarten', NULL, NULL, NULL, NULL, '4', 'http://www.wien.gv.at/spaziergang/ringlinien/burggarten.html');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (319, '"1. Opernring 2"', 'City walks', NULL, 'Die Wiener Staatsoper hat neben internationale Spitzeninterpreten und Regisseuren ein eindrucksvolles Repertoire zu bieten. Einmal im Jahr findet der renommierte Wiener Opernball im Haus an der Ringstrasse statt.', NULL, 'Die Wiener Staatsoper hat neben internationale Spitzeninterpreten und Regisseuren ein eindrucksvolles Repertoire zu bieten. Einmal im Jahr findet der renommierte Wiener Opernball im Haus an der Ringstrasse statt.',0,0, 48.2030808140894, 16.369025410027447, 'Staatsoper', NULL, NULL, NULL, NULL, '4', 'http://www.wien.gv.at/spaziergang/ringlinien/staatsoper.html');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (320, '"1. Bösendorferstraße 12"', 'City walks', NULL, 'Ein Traditionshaus im klassischen Konzertleben ist der Wiener Musikverein. Aus seinem Goldenen Saal wird alljährlich das Neujahrskonzert der Wiener Philharmoniker im Fernsehen übertragen.', NULL, 'Ein Traditionshaus im klassischen Konzertleben ist der Wiener Musikverein. Aus seinem Goldenen Saal wird alljährlich das Neujahrskonzert der Wiener Philharmoniker im Fernsehen übertragen.',0,0, 48.20051807605184, 16.372619856738375, 'Musikverein', NULL, NULL, NULL, NULL, '4', 'http://www.wien.gv.at/spaziergang/ringlinien/musikverein.html');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (321, '"3. Schwarzenbergplatz"', 'City walks', NULL, '"Der Schwarzenbergplatz liegt auf Flächen des ehemaligen Wiener ""Glacis"". Der Hochstrahlbrunnen entstand 1873 anlässlich der Fertigstellung der 1. Wiener Hochquellwasserleitung. Aus dem Jahr 1945 stammt das ""Denkmal zu Ehren der Soldaten der Sowjetarmee"" von der Roten Armee zur Erinnerung an die Befreiung Wiens errichtet. "', NULL, '"Der Schwarzenbergplatz liegt auf Flächen des ehemaligen Wiener ""Glacis"". Der Hochstrahlbrunnen entstand 1873 anlässlich der Fertigstellung der 1. Wiener Hochquellwasserleitung. Aus dem Jahr 1945 stammt das ""Denkmal zu Ehren der Soldaten der Sowjetarmee"" von der Roten Armee zur Erinnerung an die Befreiung Wiens errichtet. "',0,0, 48.19835350660436, 16.37611206158612, 'Schwarzenbergplatz / Hochstrahlbrunnen', NULL, NULL, NULL, NULL, '4', 'http://www.wien.gv.at/ma42/parks/schwarzengeschichte.htm');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (322, '"1. Parkring"', 'City walks', NULL, 'Der Stadtpark entstand nach Schleifung der Wiener Stadtmauer und Errichtung der Ringstraße um 1860 im Bereich des ehemaligen Wasserglacis vor dem Karolinenstadttor. Er war Wiens erste öffentliche Parkanlage.', NULL, 'Der Stadtpark entstand nach Schleifung der Wiener Stadtmauer und Errichtung der Ringstraße um 1860 im Bereich des ehemaligen Wasserglacis vor dem Karolinenstadttor. Er war Wiens erste öffentliche Parkanlage.',0,0, 48.2044543118819, 16.380209432776045, 'Stadtpark', NULL, NULL, NULL, NULL, '4', 'http://www.wien.gv.at/umwelt/parks/anlagen/stadtpark.html');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (323, '"1. Stubentor 5"', 'City walks', NULL, '"Im MAK wird Design groß geschrieben. Vom Mittelalter bis heute zeigt das Museum Möbel Glas Porzellan Silber und Textil. "', NULL, '"Im MAK wird Design groß geschrieben. Vom Mittelalter bis heute zeigt das Museum Möbel Glas Porzellan Silber und Textil. "',0,0, 48.2078539654110, 16.38193140594264, 'MAK - Museum für angewandte Kunst/Gegenwartskunst', NULL, NULL, NULL, NULL, '4', 'http://www.wien.gv.at/spaziergang/ringlinien/mak.html');
INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (324, '"1. Georg-Coch-Platz 2"', 'City walks', NULL, 'Als wichtigster Architekt seiner Epoche veränderte Otto Wagner nachhaltig das Stadtbild von Wien. Die Österreichische Postsparkasse von 1912 (Wettbewerb 1903) ist eines der wichtigsten Beispiele innovativer Baukunst Anfang des 20. Jahrhunderts. ', NULL, 'Als wichtigster Architekt seiner Epoche veränderte Otto Wagner nachhaltig das Stadtbild von Wien. Die Österreichische Postsparkasse von 1912 (Wettbewerb 1903) ist eines der wichtigsten Beispiele innovativer Baukunst Anfang des 20. Jahrhunderts. ',0,0, 48.2099834782878, 16.380952365615936, 'Postsparkasse', NULL, NULL, NULL, NULL, '4', 'http://www.wien.gv.at/spaziergang/ringlinien/otto-wagner-postsparkasse.html');
