INSERT INTO  locations (id,address,csvname,"date",description,district,email,nrating,rating,latitude,longitude,"name","number",phone,schedule,street,"type",website) VALUES (2635, 'Albertinaplatz 1 ', 'Top places', NULL, 'Die Albertina besitzt nicht nur eine der größten und wertvollsten grafischen Sammlungen der Welt mit Werken wie Dürers Feldhase und Klimts Frauenstudien. Ihre neue Schausammlung präsentiert Meisterwerke der Moderne und spannt damit den Bogen von Monet über Picasso zu Baselitz.', '1010', 'info@albertina.at',0,0, 48.2048541, 16.368159, 'Albertina', NULL, NULL, NULL, NULL, 'museum', 'http://www.albertina.at/');
